# Original data\ndata = [\n    ('url#id1', 'url#predicate1', 'value1'),\n    ('url#id1', 'url#predicate2', 'value2'),\n    ('url#id1', 'url#predicate3', 'value3'),\n    ('url#id2', 'url#predicate1', 'value4'),\n    ('url#id2', 'url#predicate2', 'value5')\n]\n\n# Function to transform the data\ndef format_to_table(data):\n    # Dictionary to hold ids and their corresponding predicate-value pairs\n    table_dict = {}\n    predicates_set = set()\n\n    # Populate dictionary\n    for id_part, predicate, value in data:\n        _, obj_id = id_part.split('#')\n        _, pred_name = predicate.split('#')\n        \n        if obj_id not in table_dict:\n            table_dict[obj_id] = {}\n        table_dict[obj_id][pred_name] = value\n        \n        # Collect all predicates names for column headers\n        predicates_set.add(pred_name)\n\n    # Sort predicates to ensure consistent order of columns\n    predicates_list = sorted(predicates_set)\n    \n    # Construct the final 2D list\n    formatted_table = [[''] + predicates_list]\n    for obj_id, values in table_dict.items():\n        row = [obj_id] + [values.get(predicate, '') for predicate in predicates_list]\n        formatted_table.append(row)\n\n    return formatted_table\n\n# Usage\ntable = format_to_table(data)\nprint(table)